// import logo from './logo.svg';
import './App.css';

const data = [{name: 'Turuu', number: '99033561'},
{name: 'Erdem', number: '99998811'},
{name: 'Baldaa', number: '98763890'},
{name: 'Bayraa', number: '90876321'},
{name: 'Munkh-tsog', number: '93365412'}]

const Contact = (props) => {
  return(
    <div className="contact">
      <h1>{props.name}</h1>
      <p>{props.number}</p>
    </div>
  )
}
function App() {
  return (
    <div className="App">
     {data.map((item, index) => (
      <Contact name = {item.name} number = {item.number} />
     ))}
    </div>
  );
}

export default App;
